{
  "overrides": [
    {
      "files": ["./docs/**/*.mdx"],
      "options": {
        "singleQuote": true
      }
    }
  ]
}

{
  "compilerOptions": {
    "target": "ES2018",
    "module": "commonjs",
    "moduleResolution": "node",
    "strict": true,
    "importHelpers": false,
    "noEmitHelpers": false,
    "skipLibCheck": true,
    "outDir": "./dist",
    "baseUrl": "./packages",
    "paths": {
      "@vercel/webpack-nft": ["webpack-nmt/src/index.ts"]
    }
  },
  "exclude": ["node_modules", "target"]
}

{
  "$schema": "https://openapi.vercel.sh/vercel.json",
  "git": {
    "deploymentEnabled": {
      "benchmark-data": false,
      "gh-pages": false
    }
  }
}
